import React from 'react'
import data from './data'

const Projects = () => {
    // const {id, img} = data;

    return (
        <section id='projects'>
            <div className="container">
                <h2>Projects</h2>
                {data.map((item) => {
                    const {id, img} = item;
                    return <img src={img} key={id} />
                })} 
            </div>
        </section>
    )
}

export default Projects
